import React from "react";
import { Button, ButtonGroup } from "reactstrap";

Button.propTypes = {
  active: PropTypes.bool,
  "aria-label": PropTypes.string,
  block: PropTypes.bool,
  color: PropTypes.string, // default: 'secondary'
  disabled: PropTypes.bool,
  outline: PropTypes.bool
};

const Linksr1 = props => {
  return (
    <ButtonGroup size="lg">
      <Button color="info" className="p-3">
        <img src="http://wellvana.com/wp-content/uploads/2019/10/wellvana-graphic-icons2_0005_motus-creative-group-marketing-agency-service-icons-branding-Asset-1.png"></img>
        <p>Find a Wellvana Provider</p>
      </Button>
      <Button color="info">
        <img src="http://wellvana.com/wp-content/uploads/2019/10/wellvana-graphic-icons-1_0007_Layer-14.png"></img>
        <p>Patient Resources</p>
      </Button>
    </ButtonGroup>
  );
};

export default Linksr1;
